import React from "react";
import Footer from "../components/Footer";
import Navbar from "../components/Navbar";
function Home() {
  return (
    <div>
      <Navbar />
      <div className="home">
        <div className="content">
          <div class="typing-demo">
            <h1>Welcome to Procurement Guide</h1>
          </div>
        </div>
        <Footer />
      </div>
    </div>
  );
}

export default Home;
